import React, {useState, useEffect} from 'react'
import Axios from 'axios';
import Grid from '@mui/material/Grid';
import { useParams, Link } from 'react-router-dom'

const EditVaultData = () => {
    const [vault, setVault] = useState([]);
    const { id, vaultid } = useParams();


    function traerVault() {
        Axios.get(`/api/vaults/${id}/${vaultid}`)
            .then(res => {
                setVault(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    useEffect(() => {
        traerVault();
    }, [vault]);

    console.log(id);
    console.log(vaultid);
    console.log(vault);
    return (
        <>
